// Imports
import { Link, Outlet } from "react-router-dom";


export default function Profiles() {
  // Aquí se haria la llamada a la API para obtener los perfiles
  const profiles = [
    { id: 1, name: 'John Doe', age: 30 },
    { id: 2, name: 'Jane Smith', age: 25 }, 
    { id: 3, name: 'Alice Johnson', age: 28 },
    { id: 4, name: 'Bob Brown', age: 35 },  
    { id: 5, name: 'Charlie White', age: 22 }
  ];

  return (
    <div style={{ maxWidth: 400, margin: "40px auto", background: "#23272f", borderRadius: 12, padding: 32, boxShadow: "0 4px 24px rgba(0,0,0,0.18)" }}>
      <h2 style={{ textAlign: "center", marginBottom: 24 }}>Perfiles</h2>
      <ul style={{ listStyle: "none", padding: 0, marginBottom: 32 }}>
        {profiles.map(profile => (
          <li key={profile.id} style={{ marginBottom: 16 }}>
            <Link 
              to={`/profiles/${profile.id}`} 
              style={{
                display: "block",
                padding: "12px 20px",
                borderRadius: 8,
                background: "#353b48",
                color: "#fff",
                textDecoration: "none",
                fontWeight: 500,
                transition: "background 0.2s"
              }}
              onMouseOver={e => e.currentTarget.style.background = "#4f8cff"}
              onMouseOut={e => e.currentTarget.style.background = "#353b48"}
            >
              {profile.name} <span style={{ color: "#b0b8c1", fontSize: 14 }}>({profile.age} años)</span>
            </Link>
          </li>
        ))}
      </ul>
      <Link className="button-custom" to="/" style={{ display: "block", textAlign: "center" }}>
        Ir al inicio
      </Link>
      <Outlet />
    </div>
  )
}
